import React from "react";
import { Counter } from "./Counter";
import { CounterDisplay } from "./CounterDisplay";
import { Hello } from "./Hello";
import { Welcome } from "./Welcome";

export class App extends React.Component {
  render() {
    return (
      <div>
        <Hello />
        <Welcome name="John" />
        <Counter />

      </div>
    );
  }
}
